const Galeria = (props) => {
    return(
        <main class="holder">
        <div class="galeria">
            <img src="img/prado/remera2.jpg" alt=""></img>            
            <img src="img/prado/cludafuera.jpg" alt=""></img>
            <img src="img/prado/cancha360.jpg" alt=""></img>
            <img src="img/prado/dobles.jpg" alt=""></img>
            <img src="img/prado/jugando.jpg" alt=""></img>
            <img src="img/prado/nena.jpg" alt=""></img>
            <img src="img/prado/equipo2.jpg" alt=""></img>
        </div>
    </main>
    );
}

export default Galeria;
